import './App.scss';
import React from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
} from "react-router-dom";
import LandingPage from './components/LandingPage';
import PricingPage from './components/PricingPage';

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/">
          <LandingPage/>
        </Route>
        <Route path="/pricing">
          <PricingPage/>
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
